    <script>
      $("rect").click(function(e){
        var id = e.target.id;

        $.post("<?= $data["rootUrl"] ?>entrys/positionvalidate",{position:id},function(data){
          if(!data){
            alert("No es una posición valida")
          }else{
            console.log(data);
            $.post("<?= $data["rootUrl"] ?>entrys/positionvalidateget",data,function(res){
              limpiar()
              res.forEach((res,index)=>{
                $(`#T${index+1}`).html(res.serial);
                $(`#NOMBRE${index+1}`).html(res.nombre);
              })
            },'Json')
          }
        },'Json')
      })
      function limpiar(){
        for(var i=1; i<4; i++){
            $(`#T${i}`).html('');
            $(`#NOMBRE${i}`).html('');
        }
      }

    </script>
